import '../../asset/CSS/Main.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
const Login_ = () => {
    const submit = () => {
        let dulieu = { username : 'vanquy33338888@gmail.com', password : 'vanquy' }
        axios.post('http://localhost:5000/login', dulieu).then(function (response) {
           console.log(response);
        }).catch(function (error) {
            alert(error)
        });
        // axios.post('http://localhost:5000/send-mail', {mail : Ten}).then(function (response) {

        //     console.log(JSON.parse(response.config.data));
        // })
        //     .catch(function (error) {
        //         alert(error)
        //     });
    }
    return (
        <div>
            <div className="container">
                <div className="row">
                    <div className="col-lg-6" style={{ margin: 'auto' }}>
                        <div className="form-group">
                            <input type="email" className="form-control input" name="email" id aria-describedby="emailHelpId" placeholder="Nhập email" />
                        </div>
                        <div className="form-group">
                            <input type="password" className="form-control input" name="password" id placeholder="Nhập Mật Khẩu" />
                        </div>
                        <div className="form-check">
                            <label className="form-check-label">
                                <input type="checkbox" className="form-check-input" defaultValue="checkedValue" defaultChecked />
                                    Ghi Nhớ Đăng Nhập
                                </label>
                        </div>
                        <input name="submit" className="btn btn-success submit" type="submit" value="Đăng Nhập" />
                    </div>
                </div>
            </div>
        </div>
    );
}
export default Login_;
